import React from "react";
import { withRouter } from "react-router-dom";
import Card from '../../components/card'
import FormGroup from "../../components/form-group";
import SelectMenu from "../../components/selectMenu";
import lancamentosTable from "./lancamentosTable";
import LancamentosTable from "./lancamentosTable";


class ConsultaLancamentos extends React.Component{
    render(){

        const meses = [
            { label: 'Selecione...', value: ''},
            { label: 'Janeiro', value: ''},
            { label: 'Fevereiro', value: ''},
            { label: 'Março', value: ''},
            { label: 'Abril', value: ''},
            { label: 'Maio', value: ''},
            { label: 'Junho', value: ''},
            { label: 'Julho', value: ''},
            { label: 'Agosto', value: ''},
            { label: 'Setembro', value: ''},
            { label: 'Outubtro', value: ''},
            { label: 'Novembro', value: ''},
            { label: 'Dezemnro', value: ''}
        ]
        
    const tipos = [
        { label: 'Selecione...', value: ''},
        { label: 'Despesa', value: 'DESPESA'},
        { label: 'Receita', value: 'RECEITA'}
        ]

    const lancamentos = [
        { descricao: 'Salário', valor: 5000, mes: 1, ano: 1, tipo: 'Receita' }
    ]    

        return (
            <Card title="Consulta Lançamentos">
                <div className="row">
                    <div className="col-md-6">
                        <div className="bs-component">
                            <FormGroup htmlFor="inputAno" label="Ano: *">
                                <input type="text" 
                                       className="form-control" 
                                       id="inputAno" 
                                      // value={this.state.ano}
                                       //onChange={e => this.setState({ano: e.target.value})}
                                       placeholder="Digite o Ano" />
                            </FormGroup>
                            <FormGroup htmlFor="inputMes" label="Mês: *">
                                <SelectMenu id="inputMes" className = "form-control" lista= {meses} />
                            </FormGroup>
                            <FormGroup htmlFor="inputTipo" label="Tipo Lançamento">
                                <SelectMenu id="inputTipo" className = "form-control" lista= {tipos} />
                            </FormGroup>
                            <button type="button" className="btn btn-success">Buscar</button>
                            <button type="button" className="btn btn-danger">Cadastrar</button>

                        </div>
                    </div>
                </div> 
                <br/>
                <div className="row">
                    <div className="col-md-12">
                        <div className="bs-compoment"></div>
                        <LancamentosTable lancamentos={lancamentos} />
                    </div>

                </div>

            </Card>

        )

    }

}
export default withRouter(ConsultaLancamentos)
